In New Zealand, the teenager Janey, her young brother Jim, her mother Kate and her father Ed are spending their summer vacation in a seaside cottage. Janey takes care of Jim most of the time, teaches him how to have endurance
under the water, and observes the behavior of her parents, whose marriage is near the end. Kate and Ed promote many parties in the house and mainly Kate drinks a lot. She is also having an affair with the photographer and owner of a boat, Cady. The confused adolescent, rebel with her mother and dealing with a growing sexuality, tries to act like an adult with tragic consequences to the family.

